  input: TEXT,F3XA,,"In response to your letter, please npote that the Committee po
    box had closed and the letters did not get forwarded to the Committee.  Regarding
    your request for Best Efforts, the Committee follows Commission guidelines for
    obtaining this information.  The first request is made in the original solicitation
    in a clear and conspicious manner.  If the donor does not provide the information,
    a letter is sent within 30 days explaining the law and asking for the information.  A
    pre-stamped, pre-addressed envelope is provided.  Any information turned in to
    the Committee is reported to the Commission on the next regular report or in an
    amended report.  We have correctly reported the PAC contributions on Schedule
    A supporting Line 11(c).  The information that donors provided regarding their
    occupation is reported as they have provided it.  We are follwoing up with those
    donors whose occupations do not meet your standards.  The contribution from NAMPAC
    whose check says it is a qualified multicandidate committee, was taken by the
    Committee under the impression by the Committee that tghe contribution was proper.  Since,
    however, we are unable to make certian, we have refunded the money and that refund
    will appear in our year-end report.  Please contact me with any questions at 202/479-7042.  Per
    Commission guidelines, the non-federal schedules have been filed on paper."
